import React from 'react';
import MonthlyChart from '~/pages/chart.js';

const data = [
    { month: 'Jan', usage: 5, amount: 50000 },
    { month: 'Feb', usage: 7, amount: 70000 },
    { month: 'Mar', usage: 9, amount: 90000 },
    { month: 'Apr', usage: 4, amount: 40000 },
    { month: 'May', usage: 6, amount: 60000 },
    { month: 'Jun', usage: 8, amount: 80000 },
    { month: 'Jul', usage: 7, amount: 70000 },
    { month: 'Aug', usage: 8, amount: 80000 },
    { month: 'Sep', usage: 4, amount: 40000 },
    { month: 'Oct', usage: 5, amount: 50000 },
    { month: 'Nov', usage: 7, amount: 70000 },
    { month: 'Dec', usage: 9, amount: 90000 },
];

const datas = [
    { name: 'Jan', waterUsage: 0.5, maxWater: 1 },
    { name: 'Feb', waterUsage: 0.7, maxWater: 10 },
    { name: 'Mar', waterUsage: 0.9, maxWater: 1 },
    { name: 'Apr', waterUsage: 0.4, maxWater: 1 },
    { name: 'May', waterUsage: 0.6, maxWater: 1 },
    { name: 'Jun', waterUsage: 0.8, maxWater: 1 },
    { name: 'Jul', waterUsage: 0.7, maxWater: 1 },
    { name: 'Aug', waterUsage: 0.8, maxWater: 1 },
    { name: 'Sep', waterUsage: 0.4, maxWater: 1 },
    { name: 'Oct', waterUsage: 0.5, maxWater: 1 },
    { name: 'Nov', waterUsage: 0.7, maxWater: 1 },
    { name: 'Dec', waterUsage: 0.9, maxWater: 1 },
];

const App = () => {
    return (
        <div>
            <h1>Monthly Water Consumption and Bill</h1>
            <MonthlyChart data={data} />
            <MonthlyChart data={datas} />
        </div>
    );
};

export default App;
